import React, { Component } from "react";
import Buscador from "./component/buscador";

function App() {
  return (
    <div className="app container">
      <div className="jumbotron">
        <p className="lead text-center">Buscador De imagenes</p>
        <Buscador />
      </div>
    </div>
  );
}

export default App;
